import React from 'react';

const Individual = (props) => {
	return (
		<div style={style.Container}>
			<p style={style.Text}>
				<b style={{ fontWeight: '400' }}>{props.name}</b> - {props.major}
				<br />
				Role: {props.role}
				<br />
			</p>
		</div>
	);
};

let style = {
	Container: {
		display: 'flex',
		alignItems: 'center',
	},
	Text: {
		fontSize: '1.25rem',
		fontWeight: '300',
		color: 'black',
	},
};

export default Individual;
